import React, { Component } from 'react';
import './ListItem.css';
 
const ListItem =(props)=>{
    const item=props.item
    if(item.done){
        return(
            <div>
                <p className="done-item">{item.content}</p>
                <button>make it false</button>
            </div>
            
        );
    }else{
        return(
            <div>
                <p className="item">{item.content}</p>
                <button>make it ture</button>
            </div>
        )
    }
}

export default ListItem;
